// src/components/Navbar.jsx
import React from 'react';

const Navbar = () => {
  return (
    // Main navigation bar container with flexbox for layout
    <nav className="flex justify-between items-center py-4 px-8 bg-gradient-to-r from-teal-600 to-green-500">

      {/* Logo section */}
      <div className="text-white text-xl font-bold">ZAKER</div>

      {/* Navigation links */}
      <div className="space-x-4">
        <button className="text-white">Home</button> {/* Home button */}
        <button className="text-white">Login</button> {/* Login button */}
        <button className="text-white">Create Account</button> {/* Create Account button */}

        {/* Language dropdown */}
        <select className="bg-white text-teal-600 px-2 py-1 rounded">
          <option>العربية</option>
          <option>English</option>
        </select>
      </div>
    </nav>
  );
};

export default Navbar;
